import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Navbar";
import Home from "./Home";
import Resident from "./Resident";
import Merchant from "./Merchant";
import Signin from "./Signin";
import Howitworks from "./Howitworks";
import About from "./About";
import Signup from "./Signup";
import SignUpChoice from "./SUC";

function App() {
  let Component;
  switch (window.location.pathname) {
    case "/":
      Component = Home;
      break;
    case "/ressignup":
      Component = Resident;
      break;
    case "/msignup":
      Component = Merchant;
      break;
    case "/signupc":
      Component = SignUpChoice;
      break;
    case "/signin":
      Component = Signin;
      break;
    case "/hiw":
      Component = Howitworks;
      break;
    case "/about":
      Component = About;
      break;
    case "/signup":
        Component = Signup;
      break;
  }
  return (
    <>
      <Navbar />
      <Component />
    </>
  );
}

export default App;
